  console.log(data);

  const iconUrl =
    "https://openweathermap.org/img/wn/" + `${data.weather[0].icon}` + ".png";

  return (
    <div className="displayweather">
     {data.code != '404'}
    </div>
  );
}

export default DisplayWeather;
